import React from 'react'

class MyForm extends React.Component {
  constructor(props) {
    super(props)
    this.state = { username: "" }
  }
  myChangeHandler = (event) => {
    this.setState({username: event.target.value})
  }
  render() {
    return (
      <form>
        <h1>Hello</h1>
        <p>Enter your name:</p>
        <input
          type="text"
        />
      </form>

    );
  }
}

export default MyForm;
